import { GET_ERRORS } from "../Types/Types";
import apiURL from "../../Components/Re-usable/Api Url/apiURL";

export const createNewUser = async(newUser, history)    => {
    try {
        await apiURL.post("/api/users/register", newUser);
        history.push("/login");
        // dispatch({
        //     type: GET_ERRORS,
        //     payload: {}
        // });
        console.log("User registration")
    } catch (err) {
        // dispatch({
        //     type: GET_ERRORS,
        //     payload: err.response.data
        // });
    }
};
